import React, {useEffect, useState} from 'react';

function ClientInfo() {
    useEffect( () => {
        fetchItems();
    }, []);

    const [items, setItems] = useState([]);

    const fetchItems = async() => {
        const data = await fetch('/BackendData');
        const items = await data.json();
        setItems(items);
    };

    return(
        <>
        <div>hi</div>
        <section>
        {
            items.map((item: any) => (
                <p>{item.name}</p>
            ))
        }
        </section>
        </>
    )
}

export default ClientInfo;
